import React from 'react';
import UserForm from 'utils/userForm';

const User = () => {
  return (
    <>
      <div className="content-wrapper">
      {/* Content Header (Page header) */}
        <section className="content-header">
          <div className="container-fluid">
            <div className="row mb-2">
              <div className="col-sm-6">
                <h1>User Page </h1>
              </div>
              <div className="col-sm-6">
                <ol className="breadcrumb float-sm-right">
                  <li className="breadcrumb-item"><a href="#">Home</a></li>
                  <li className="breadcrumb-item active">User</li>
                </ol>
              </div>
            </div>
          </div>{/* /.container-fluid */}
        </section>
        {/* Main content */}
        {/* <section className="content">
          <div className="row">
            <Form mainContent="Login" email="Email" pass="Password"/>
            <Form mainContent="Register" title="Name" uname="User Name" email="Email"  pass="Password"/>
            
          </div>
          <div className="container">
            <Table title="Daftar User" namaLengkap="Nama Lengkap" uname="User Name" email="Email"/>
          </div>
        </section> */}
        <div className="container">
          <UserForm/>

        </div>
      </div>
    </>
  );
}

export default User;
